import React, { Component } from 'react'

export default class Search extends Component {
    render() {
        return (
            <div className="offset-3">
                <div className="card row">
                    <label for="search" className="col-md-1">Search:</label>
                    <input id="search" className="form-control w-50 col-md-8" type="text"/>
                </div>
            </div>
        )
    }
}
